import Button from './components/Button';
import Pricing from './pages/Pricing';
import Services from './pages/Services';
import CRM from './pages/CRM';

function App() {
  return (
    <Router>
      <header className="flex justify-between items-center px-8 py-4 shadow-md bg-white sticky top-0 z-50">
        <div className="text-2xl font-bold text-yellow-500">Unnati Renewables</div>
        <nav className="space-x-6 hidden md:flex">
          <Link to="/" className="hover:text-yellow-500">Home</Link>
          <Link to="/services" className="hover:text-yellow-500">Services</Link>
          <Link to="/pricing" className="hover:text-yellow-500">Pricing</Link>
          <Link to="/crm" className="hover:text-yellow-500">CRM</Link>
        </nav>
        <Button className="bg-yellow-500 text-white hover:bg-yellow-600">Get a Quote</Button>
      </header>

