        <Route path="/" element={<div className="p-10 text-center text-2xl">Welcome to Unnati Renewables ðŸŒž</div>} />
        <Route path="/pricing" element={<Pricing />} />
        <Route path="/services" element={<Services />} />
        <Route path="/crm" element={<CRM />} />
      </Routes>
    </Router>
  );
}

export default App;
